import { checkPropTypes } from "prop-types";

function Hari1(props){
    return(
        <div>
        <p>
        Fistname:{props.fname}<br/>
        Lastname:{props.lname}<br/>
        age:{props.age}<br/>
        email:{props.email}<br/>
        phonenumber:{props.phonenumber}
        </p>

        </div>
    )
}
function Hari(){
    return(
        <div>
            <h2>empolye details</h2>
            <p Hari fname="Naveen" lname="yakkaluru" age="24" email="naveenyakkalur866@gamil.com" phonenumber="8096406082"></p>

        </div>
    )
}
export default Hari;
